import React from "react";
import moduleName from 'module'

function NameList() {
  const persons = [
    {
      id: 1,
      name: "sravan",
      age: 24,
      skill: "react",
    },
    {
      id: 2,
      name: "krishna",
      age: 24,
      skill: "angular",
    },
    {
      id: 3,
      name: "kumar",
      age: 24,
      skill: "native",
    },
    {
      id: 4,
      name: "reddy",
      age: 24,
      skill: "node",
    },
  ];
  const personList = persons.map((person) => <Person person={person} />);
  return <div>{personList}</div>;
}

export default NameList;
